import React from "react";
// nodejs library to set properties for components
import PropTypes from "prop-types";
// @material-ui/core components
import withStyles from "@material-ui/core/styles/withStyles";

// @material-ui/icons

// core components
import GridContainer from "components/Grid/GridContainer.jsx";
import GridItem from "components/Grid/GridItem.jsx";
import CustomInput from "components/CustomInput/CustomInput.jsx";
import Button from "components/CustomButtons/Button.jsx";

import Background from "assets/img/p4.png";

//import anotherExample from "../../../../../api/uploads"
import Ejemplo from "assets/img/faces/avatar.jpg"

import workStyle from "assets/jss/material-kit-react/views/landingPageSections/workStyle.jsx";
import { relative } from "path";



const sectionStyle = {
  position: relative,
  width: "100%",
  height: "780px",
  backgroundPosition: 'center center',
  backgroundRepeat : 'no-repeat',
  backgroundAttachment: 'fixed',
  backgroundSize: 'cover',
  backgroundImage: `url(${Background})`

};

const conta ={
  padding: "200"
}

const imgStyle = {
  left: "230px",
  width: "100%",
  maxWidth: "350px",
  height: "350px",
  top:"190px",
  position: "fixed",
}

const imgStyle2 = {
  left: "530px",
  width: "100%",
  maxWidth: "350px",
  height: "350px",
  top:"190px",
  position: "fixed",
}


class WorkSection extends React.Component {
  render() {
    const { classes } = this.props;
    return (
       <section style={ sectionStyle }>
         <div >
         <GridContainer style={conta}>
         <GridContainer item xs={12} spacing={4}>

          <GridItem xs={12}>
            <img src={Ejemplo} style={imgStyle}/>
            <img src={Ejemplo} style={imgStyle2}/>

          </GridItem>


          </GridContainer>
          </GridContainer>
        </div>
      </section>
    );
  }
}

WorkSection.propTypes = {
  classes: PropTypes.object
};

export default withStyles(workStyle)(WorkSection);
